import React, { useState } from 'react';
import './Projects.css';
import { ReactComponent as ProjectsSVG } from '../../content/imgs/projects.svg'
import p1 from '../../content/imgs/portfolio-1.gif';
import p2 from '../../content/imgs/portfolio-2.png';
import p3 from '../../content/imgs/portfolio-3.png';
import p4 from '../../content/imgs/portfolio-4.gif';

function Projects() {
    const [infoText, setInfoText] = useState("These are some of my favorite projects! Feel free to hover over each image to learn more.")
    const changeText = (newText) => setInfoText(newText);

    return(
        <div className="projectsContainer">
            <div className="title2">
                <ProjectsSVG />
                {infoText}
            </div>
            <div className="projectsGrid">
                <img className="projectPic" src={p1} onMouseOver={changeText("new text")}></img>
                <img className="projectPic" src={p2} ></img>
                <img className="projectPic" src={p3} ></img>
                <img className="projectPic" src={p4} ></img>
            </div>
        </div>
    );
}

export default Projects;
